import logo from './logo.svg';
import './App.css';
import {Component} from 'react';

class App extends Component {
  constructor(){
    super();
    this.state = {
      monsters:[
        { id: '1',
          name: 'Frankestein'
        },
        {
          id: '2',
          name: 'Dracula'
        },
        {
          id: '3',
          name: 'Zombie'
        },
      ],

    }
  }
  componentDidMount(){
    fetch('https://jsonplaceholder.typicode.com/users')
    .then(response => response.json())
    .then()
  }

  render() {
    return (
      <div className="App">
       {
        this.state.monsters.map(monster =>
           <h1>{monster.name}</h1>)
       }
      </div>
    );
  }
} 


export default App;
